var HTML_DECODE = {
    "&lt;" : "<",
    "&gt;" : ">",
    "&amp;" : "&",
    "&nbsp;": " ",
    "&quot;": "\"",
    "©": ""
    // Add more
};
var REGX_HTML_ENCODE = /"|&|'|<|>/g;

//转义的代码
var s_encodeHtml = function(s){
    s = (s != undefined) ? s : this.toString();
    return (typeof s != "string") ? s :
        s.replace(REGX_HTML_ENCODE,
            function($0){
                var c = $0.charCodeAt(0), r = ["&#"];
                c = (c == 0x20) ? 0xA0 : c;
                r.push(c); r.push(";");
                return r.join("");
            });
};
function transferString(content){
    var string = content;
    try{
        string = s_encodeHtml(string);
        //string=string.replace(/\r\n/g,"<BR>");
        string=string.replace(/\n/g,"<BR>");
        //string=string.replace(/\s+/g,'&nbsp;');
        string=string.replace(/\s/g,'&nbsp;')

    }catch(e) {
        alert(e.message);
    }
    return string;
}


//将表情替换成图片
function getImgByKey(str){
    var reg = /~:[a-c][0-9]~/g;
    str = transferString(str);
    return str.replace(reg,function(word){
        return word.replace(word,emotionPicData[word]);
    });
}

