/***
 * 根据群id初始化群成员列表
 */
function initGroupMembers(groupId,groupCreator){
    deleteGroupMemberListInfo();

    if(null != groupId && undefined != groupId && "" != groupId){
        RKCloudIM.chat.getGroupUsers(groupId, {
            onSuccess:function(usersArrayObj){
                var groupMasterHtml = "";
                var groupOtherHtml  = "";
                var groupLoginHtml = "";
                var currLoginName = RKCloudIM.getUserName();
                for(var i = 0;i < usersArrayObj.length;i++) {
                    var accStr = usersArrayObj[i];
                    var html = "";
                    html += "	<li id='chat_" + accStr + "' alt='" + accStr + "' " + (accStr != currLoginName ? "href='javascript:void(0)'" : "") + ">";
                    html += "	<div class='col-md-10 user-list-div'><i class='fa fa-user fa-2x user-head'></i><p>" + accStr + "</p>";
                    html += "	</div>";
                       html += "     <div  class='col-md-2'>";
                        //如果是自己，不需要添加踢出功能
                    if (accStr != currLoginName && groupCreator == currLoginName) {
                        html += "<span class='fa fa-minus-circle delete-list' id='kickUser_"+ accStr+"' alt='" + accStr + "' class='kickUserClass list-group-item' href='javascript:void(0)' ></span>";
                    }
                     html += " </div>";
                      html += "</li>";
                    html += "";
                    //遍历的账号 == 创建者账号 == 是群主的话 不是登录者
                    if(accStr == groupCreator && currLoginName != groupCreator){
                        groupMasterHtml = html;
                        continue;
                    }

                    //遍历的账号 == 登录者账号 ==  不是群主 是登录者
                    if(accStr == currLoginName && currLoginName != groupCreator){
                        groupLoginHtml = html;
                        continue;
                    }

                    //                            既是群主 又是登录者
                    if(accStr == currLoginName && currLoginName == groupCreator){
                        groupMasterHtml = html;
                        continue;
                    }
                    else groupOtherHtml+=html;
                }

                $("#groupOfMember").append(groupMasterHtml+""+groupLoginHtml+""+groupOtherHtml);
                for(var i = 0;i < usersArrayObj.length;i++) {
                    var accStr = usersArrayObj[i];
                    if (accStr != currLoginName) {
                        $("#chat_" + accStr).bind("click", function () {

                            //打开单聊页面
                            userBindMethod($(this).attr("alt"));

                            //给单聊页面加返回群组按钮
                            addReturnSelfGroup($(this).attr("alt"),groupId);
                        });
                    }

                    if(accStr != currLoginName && groupCreator == currLoginName){
                        //给踢人添加事件
                        $("#kickUser_"+accStr).bind("click", function () {
                            kickUser($(this).attr("id"), groupId, $(this).attr("alt"));
                        });
                    }
                }

                $("#mou_head_group_mem").append("<span id='groupMemberCount_"+groupId+"' class='groupMemCount'>("+usersArrayObj.length+")</span>");
            },
            onFail : function(errorCode){
                if(errorCode == RKCloudIM.RKCloudErrorCode.RK_SDK_UNINIT){
                    alert("获取群成员信息失败：SDK未初始化成功");
                }else if(errorCode == RKCloudIM.RKCloudErrorCode.CHAT_GROUP_NOT_EXIST){
                    alert("获取群成员信息失败：群不存在");
                }else if(errorCode == RKCloudIM.RKCloudErrorCode.CHAT_GROUP_USER_NOT_EXIST){
                    alert("获取群成员失败：非群成员");
                }else if(errorCode == RKCloudIM.RKCloudErrorCode.RK_PARAMS_ERROR){
                    alert("获取群成员失败：参数错误");
                }else{
                    alert("获取群成员信息失败");
                }
            }
        });
    }
}

