/**
 * 添加新消息提示
 * @param accGroupId 账号 或者 群组id
 * @param chatType  群聊 或者单聊
 */
function addCercleMsg(accGroupId,chatType){

    var obj = $("#main_"+accGroupId);
    var leftMenuObj = $("#"+accGroupId);

    //聊天区已经存在
    if(null != obj && undefined != obj ){
        var divDisplay = document.getElementById("main_"+accGroupId).style.display;
        //var divDisplay =  $("#main_"+accGroupId).css("display");

        //不存在时，添加新消息提示
        if(("" == divDisplay || "none" == divDisplay) && (null != leftMenuObj && undefined != leftMenuObj)){
            deleteCercleInfo(accGroupId);
            $("#" + accGroupId).parent().append(cercleHtml(accGroupId));

            $("#cercle_" + accGroupId).bind("click", function () {
                if(CHAT_TYPE_GROUP == chatType){
                    groupBindMethod($("#"+$(this).attr("cid")));
                }
                if(CHAT_TYPE_SINGLE == chatType){
                    userBindMethod($(this).attr("cid"));
                }
                $(this).remove();
            });
        }
    }
}

