//判断聊天区是否已经有显示的了
function judgeChatRoomNum(main_id){
    var defaultObj = $("#main_default");
    var currentGroupId =  $("#onLoadFirstGroup").val();
    //有别的聊天区显示  不显示本次的聊天区
    if((null != defaultObj && undefined != defaultObj && "block" == $("#main_default").css("display"))){
        return false;
    }

    //表示聊天区和自己所属的聊天区不是一个，自己这个聊天区应该隐藏
    if(main_id != currentGroupId && null != currentGroupId && undefined != currentGroupId && "" != currentGroupId){
        return true;
    }
    return false;
}

